core_metadata_found.summary:
This database contains information about the distribution of 10 different types of sea floor sediment in the Australian region. It was derived from data collected and mapped by the Ocean Sciences Institute, University of Sydney. 

Format: shapefile.

Quality - 
Scope: Dataset. 
External accuracy: +/- one degree. 
Non Quantitative accuracy: Data are assumed to be correct. 

The item called SUBSTRATE describes 9 classes: 
-----------------------------------------
Biosiliceous marl and calcareous clay; 
Calcareous gravel, sand and silt; 
Calcareous ooze; 
Land mass; 
Mud and calcareous clay; 
Mud and sand; 
Pelagic clay; 
Sand, silt and gravel with less than 50% mud; 
Volcanic sand and grit. 

Conceptual consistency: Coverages are topologically consistent. No particular tests conducted by ERIN. 
Completeness omission: Complete for the Australian continent.
